import React from "react";

const Links = (props) => {
  console.log(props);
  const toLink = (link) => {
    document.location.href = link;
  };
  return (
    <button onClick={() => toLink(props.record)}>
      <a>{props.record}</a>
    </button>
  );
};

export default Links;
